CREATE TABLE experimental_data (
  experiment_id SERIAL PRIMARY KEY,
  printing_parameters TEXT,
  material_testing_results TEXT,
  performance_analysis TEXT
);

CREATE TABLE experimental_data (
 	experiment_id INT PRIMARY KEY,
 	printing_parameters TEXT,
 	material_testing_results TEXT
);

CREATE TABLE performance_analysis (
 	analysis_id INT PRIMARY KEY,
 	experiment_id INT,
 	performance_results TEXT,
 	FOREIGN KEY (experiment_id) REFERENCES experimental_data(experiment_id)
);

CREATE TABLE 3d_printing_parameters (
   id INT PRIMARY KEY,
   parameter_name VARCHAR(50),
   parameter_value FLOAT,
   printer_model VARCHAR(50)
);
